import React, { useState } from 'react';
import { Modal, Button } from "react-bootstrap";
import Heading from '../../../../Heading';
import {
    BiXCircle
  } from "react-icons/bi";


function Delete(props, {deleteSkill}) {
    const [showDelete, setShowDelete] = useState(false);

    const content=props.content;
    const skillID=props.id;
    const icon=props.icon;
    return (
        <>
        {icon === "BiXCircle" ? 
        <BiXCircle onClick={() => setShowDelete(true)}/>
        : null}
        <Modal
        {...props}
                    size="md"
                    scrollable
                    show={showDelete}
                    onHide={() => setShowDelete(false)}
                  >
                    <Modal.Header closeButton>
                      <Modal.Title>
                        <Heading
                          content={`Delete ${content}`}
                          design="h4 my-auto"
                        />
                      </Modal.Title>
                    </Modal.Header>
                    <Modal.Body>
                    {/* <p> {dd} </p> */}
                      <p>Are you sure want to delete it?</p>
                    </Modal.Body>
                    <Modal.Footer>
                      <Button
                        variant="secondary"
                        onClick={() => setShowDelete(false), deleteSkill}
                      >
                        Close
                      </Button>
                      <Button
                        type="submit"
                        variant="primary"
                      >
                        Save Changes
                      </Button>
                    </Modal.Footer>
                  </Modal>
                  </>
    )
}

export default Delete
